    <Nav className="me-auto">
    <Link to ='/hot'>Hot</Link >
    <Link to ='/iced'>Cold</Link >
    <Link to ='/cart'>My Cart</Link>
    </Nav>
    <Nav>

    </Nav>
  </Navbar.Collapse>
  </Container>
</Navbar>
</>
)
}


export default Header
